import mixin from 'blockchain-ui-privatization/PC/common-mixin/mining/mining';
import 'blockchain-ui-privatization/PC/common-mixin/mining/mining.styl';
export default {
  mixins: [mixin],
  mounted: function mounted() {
    var info = {
      page: this.page,
      pageSize: this.pageSize
    };
    this.$store.dispatch('inviteInfoList', info); // publicInfo

    var publicInfo = this.$store.state.baseData.publicInfo;

    if (publicInfo && Number(publicInfo.switch.is_invite_open) === 1) {
      this.isInviteOpen = true;
    } else {
      this.isInviteOpen = false;
    }

    this.getData();
  }
};
